function handleClientLoad(){gapi.load("client:auth2",initClient)}function initClient(){gapi.client.init({discoveryDocs:DISCOVERY_DOCS,clientId:CLIENT_ID,scope:SCOPES}).then(function(){gapi.auth2.getAuthInstance().isSignedIn.listen(updateSigninStatus),updateSigninStatus(gapi.auth2.getAuthInstance().isSignedIn.get()),authorizeButton.onclick=handleAuthClick})}function updateSigninStatus(t){t&&addCustomEvent()}function handleAuthClick(t){gapi.auth2.getAuthInstance().signIn()}function handleSignoutClick(t){gapi.auth2.getAuthInstance().signOut()}function addCustomEvent(){var t=window.meeting_selected,e=new Date(1e3*t.time),n=new Date(e.getTime()+60*t.duration*1e3),i={start:{timeZone:"Europe/Warsaw",dateTime:e.toISOString()},end:{timeZone:"Europe/Warsaw",dateTime:n.toISOString()},summary:t.name,description:[t.client.name,t.client.tel,t.client.mail,t.client.msg].join("<br>"),colorId:"11",reminders:{overrides:[{method:"email",minutes:60},{method:"popup",minutes:60}],useDefault:!1}};gapi.client.calendar.events.insert({calendarId:"primary",resource:i}).then(function(t){console.info(t),window.location.href=window.meeting_url})}var CLIENT_ID="164399568413-37qg6nl2fd355sv1k273kcvv5kp2fkjt.apps.googleusercontent.com",DISCOVERY_DOCS=["https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest"],SCOPES="https://www.googleapis.com/auth/calendar",authorizeButton=window.meeting_btn;